const Nav = () => {
    return (
        <div>
            <nav className="navbar">
                <div className="links">
                    <a href="/">Home</a>
                    <a href="/json">Data</a>
                    <a href="/comment">Card</a>
                </div>
            </nav>
            <div>
                <div class="info">
                    <p>Student name: Nguyen Trong Son</p>
                    <p>Student ID: 26002005203</p>
                    <p>Group name: No name</p>
                </div>
            </div>
        </div>
    );
};

export default Nav;
